import React , {Component} from "react"
import {NavLink} from "react-router-dom"

class NavBar extends Component{
    render(){
        return(
            <div className="d-flex flex-column flex-md-row align-items-center p-3 px-md-4 mb-3 bg-white border-bottom shadow-sm">
                <h5 className="my-0 mr-md-auto font-weight-normal"><NavLink to="/" style={{textDecoration: "none", color: "black"}}>Online Product World</NavLink></h5>
                <nav className="my-2 my-md-0 mr-md-3">
                    <NavLink className="p-2 text-dark" to="/">Home</NavLink>
                    <NavLink className="p-2 text-dark" to="//Product/:id">New Product</NavLink>
                    <NavLink className="p-2 text-dark" to="/Login">Login</NavLink>
                    <NavLink className="p-2 text-dark" to="/Register">Registeration</NavLink>
                    <NavLink className="p-2 text-dark" to="#">Contact Us</NavLink>
                    <NavLink className="p-2 text-dark" to="#">About Us</NavLink>
                </nav>
          </div>

        )
    }
}

export default NavBar;
